DROP TABLE IF EXISTS cy_xj_event;
CREATE TABLE cy_xj_event (
  eid mediumint(8) NOT NULL auto_increment,
  tid mediumint(8) NOT NULL,
  postclass tinyint(1) NOT NULL COMMENT '/',
  starttime int(10) NOT NULL COMMENT '',
  endtime int(10) NOT NULL COMMENT '',
  offlineclass smallint(2) NOT NULL COMMENT '',
  onlineclass smallint(2) NOT NULL COMMENT '',
  citys varchar(20) NOT NULL COMMENT '',
  event_address varchar(150) NOT NULL COMMENT '',
  event_number mediumint(6) NOT NULL,
  event_number_man mediumint(6) NOT NULL,
  event_number_woman mediumint(6) NOT NULL,
  event_number_max smallint(4) NOT NULL COMMENT 'ID',
  use_extcredits_num smallint(4) NOT NULL COMMENT '',
  use_extcredits tinyint(1) NOT NULL COMMENT '',
  use_cost decimal(9,2) NOT NULL COMMENT '',
  activitybegin int(10) NOT NULL COMMENT '',
  activityexpiration int(10) NOT NULL COMMENT '',
  userfield text NOT NULL COMMENT '',
  activityaid mediumint(8) NOT NULL,
  activityaid_url varchar(200) NOT NULL COMMENT '',
  verify tinyint(1) NOT NULL COMMENT '/',
  setting text NOT NULL,
