  KEY eid (eid),
  KEY tid (tid),
  KEY postclass (postclass),
  KEY offlineclass (offlineclass,onlineclass)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 AUTO_INCREMENT=1;

